from importData import *from exportUsers import *def diffDate(ggr=ggr,vendor=vendor,name_list=name_list):    ggr=ggr[['date','username','FAMOUNT']]    ggr_day=ggr.groupby(['username','date']).sum().reset_index()    ggr_day=ggr_day[ggr_day['username'].isin(name_list)]    vendor=vendor[['date','Player ID','Player WinLoss']]    vendor_day=vendor.groupby(['Player ID','date']).sum().reset_index()    vendor_day=vendor_day[vendor_day['Player ID'].isin(name_list)]    compareDay=pd.merge(ggr_day,vendor_day,left_on=['username','date'],right_on=['Player ID','date'],how='outer').fillna(0)    compareDay['ggr']=round(compareDay['FAMOUNT'])    compareDay['WinLoss']=round(compareDay['Player WinLoss'])    compareDay=compareDay.drop(['Player WinLoss','FAMOUNT'],axis=1)    compareDay.to_csv('compareDay.csv')    print(compareDay.head())